description:
L'ordre du jour porte sur les points ci-après :
1- Poursuite de l'examen du projet de loi relatif à la Commission béninoise des droits de l'Homme ;
2- Examen de la proposition de loi portant révision de la Constitution de la République du Bénin ;
3- Examen du projet de loi portant définition et répression de l'usure en République du Bénin ;
4- Examen du projet de loi portant règlementation bancaire en République du Bénin ;
5- Examen du projet de loi modifiant et complétant la loi no 202216 du 19 octobre 2022 portant création, organisation et fonctionnement de la Cour spéciale des affaires foncières ;
6- Examen du projet de loi portant autorisation de ratification de l'accord de l'Organisation mondiale du commerce sur les subventions à la pêche adoptée à Genève, le 17 juin 2022 ;
7- Examen du projet de loi relatif à l'alimentation scolaire en 
République du Bénin 
8- Examen du projet de loi portant dispositions spéciales de procédures relatives à l'organisation de la défense des intérêts de l'Etat devant les juridictions et portant création de l'Agence judiciaire de l'Etat ;
9- Examen de la proposition de loi modifiant et complétant la loi no 2019-43 du 15 novembre 2019 portant code électoral.

L'ordre du jour de ladite session porte sur les points ci-après :

1.Projet de loi relatif au taux d'intérêt légal en République du Bénin ;
2.Projet de loi relatif à la Commission béninoise des droits de l'Homme ;
3.Projet de loi portant autorisation de ratification de la Constitution et de la Convention de l'Union africaine des télécommunications, adoptées respectivement au Cap (Afrique du Sud), le 7 décembre 1999 et à Harare (Zimbabwe), le 10 juillet 2014 ;
4.Projet de loi portant dispositions spéciales de procédures relatives à l'organisation de la défense des intérêts de l'Etat devant les juridictions et portant création de l'agence judiciaire de l'Etat ;
5.Projet de loi portant définition et répression de l'usure en République du Bénin ;
6.Projet de loi portant règlementation bancaire en République du Bénin ;
7.Projet de loi relatif aux infractions boursières sur le marché financier de l'Union monétaire ouest africaine ;
8.Projet de loi modifiant et complétant la loi 1102022-16 du 19 octobre 2022 portant création, organisation et fonctionnement de la cour spéciale des affaires foncières ;
9.Projet de loi portant autorisation de ratification de l'accord de l'organisation mondiale du commerce sur les subventions à la pêche adoptée à Genève, le 17 juin 2022 ;
10.Projet de loi relatif à l'alimentation scolaire en République du Bénin ;
11.Proposition de loi portant révision de la Constitution de la République du Bénin ;
12.Proposition de loi portant modification et complément de la loi
02019-43 du 15 novembre 2019 portant Code électoral en
République du Bénin.

L'ordre du jour porte sur les points ci-après :
l- Examen du projet de loi portant règlementation bancaire en République du Bénin ;
2- Examen du projet de loi modifiant et complétant la loi no 2022-16 du
19 octobre 2022 portant création, organisation et fonctionnement de la Cour spéciale des affaires foncières ;
3- Examen du projet de loi portant définition et répression de l'usure en République du Bénin ;
4- Examen du projet de loi relatif à l'activité d'affacturage en République du Bénin ;
5- Examen du projet de loi portant autorisation de l'accord consacrant la mise en œuvre de l'arrêt du 12 juillet 2005 de la Cour internationale de Justice relatif à l'affaire du différend frontalier Bénin/Niger, signé à Cotonou le 13 mars 2023 ;
6- Examen du projet de loi portant autorisation de ratification de la convention signée à Abu Dhabi le 04 mars 2013 entre la République du Bénin et les Emirats Arabes Unis en vue d'éviter la double imposition et de prévenir l'évasion fiscale en matière d'impôt sur le revenu ;
7- Examen du projet de loi portant autorisation de ratification de la Convention entre le gouvernement de la République du Bénin et le gouvernement de la République du Rwanda en vue d'éviter les doubles impositions en matière d'impôts sur le revenu et de prévenir l'évasion et la fraude fiscales, signée le 15 avril 2023 à
Cotonou.

L'ordre du jour de ladite séance porte sur les points ci-après •
1. Poursuite de l'examen du projet de loi relatif à la Commission béninoise des droits de l'Homme ;
2. Examen de la proposition de loi modifiant et complétant la loi
1102019-43 du 15 novembre 2019 portant Code électoral en République du Bénin ;
3. Examen du projet de loi portant règlementation bancaire en République du Bénin ;
4. Examen du projet de loi portant définition et répression de l'usure en République du Bénin ;
5. Examen du projet de loi modifiant et complétant la loi 110 2022-16 du 19 octobre 2022 portant création, organisation et fonctionnement de la cour spéciale des affaires foncières ;
6. Examen du projet de loi portant autorisation de ratification de l'accord de l'organisation mondiale du commerce sur les subventions à la pêche adoptée à Genève, le 17 juin 2022 ;
7. Examen du projet de loi relatif à l'alimentation scolaire en République du Bénin ;
8. Examen du projet de loi portant dispositions spéciales de procédures relatives à l'organisation de la défense des intérêts de
l'Etat devant les juridictions et portant création de l'agence judiciaire de l'Etat.
